        exercises: 10
      },
      {
        name: 'Using props to pass data',
        exercises: 7
      },
      {
        name: 'State of a component',
        exercises: 14
      }
    ]

  const Header = (props) => {
    console.log(props)
    return (
      <div>
        <h1>{props.course}</h1>
      </div>
    )
  }

  const Total = (props) => {
    return (
      <div>
        <p>Number of exercises {parts.exercises}</p>
      </div>
    )
  }

  const Content = (props) => {
    return (
      <div>
        <p>{props.name} {props.exercises}</p>
        <p>{props.name} {props.exercises}</p>
        <p>{props.name} {props.exercises}</p>
      </div>
    )
  }

  return (
    <div>
      <Header course={course} />
      <Content parts={parts} />
      <Total parts={parts} />
    </div>
  )
}

export default App
